import React, {Component} from 'react';
import './Header.css';

const Header = () => { 
    return (
        <div className="Header">
            <div className="Left">
                <div>Menu Place Holder</div>
            </div>
            <div className="Right">
                <LoginButton />
            </div>
        </div>
    );
}

const LoginButton = () => {
    return (
       <div> Login </div> 
    );
}

class LogButton extends Component {
    constructor(props) {
        super(props);

        this.initialState = {
            showLoginModel : false
        };

        this.state = this.initialState;
    }

    handleChange = event => {
        const {name, value} = event.target;

        this.setState({
            [name] : value
        });
    }

    submitForm = () => {
        this.props.handleSubmit(this.state);
        this.setState(this.initialState);
    }

    render() {
        const { name, job } = this.state; 

        return (
            <form>
                <label>Name</label>
                <input 
                    type="text" 
                    name="name" 
                    value={name} 
                    onChange={this.handleChange} />
                <label>Job</label>
                <input 
                    type="text" 
                    name="job" 
                    value={job} 
                    onChange={this.handleChange}/>
                 <input 
                    type="button" 
                    value="Submit" 
                    onClick={this.submitForm} />
            </form>
        );
    }
}

export default Header;
